-- Table structure for t_biz_order
-- ----------------------------
DROP TABLE IF EXISTS `t_biz_order`;
CREATE TABLE `t_biz_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `product_id` int(11) NOT NULL,
  `order_id` int(11) DEFAULT NULL COMMENT '订单流水号',
  `order_time` datetime DEFAULT NULL COMMENT '下单时间',
  `pay_time` datetime DEFAULT NULL COMMENT '购买时间',
  `address_id` int(11) NOT NULL COMMENT '收货地址',
  `state` int(11) DEFAULT NULL COMMENT '订单状态（0待发货，1已发货，2已完成,3待付款）',
  `confirm_time` datetime DEFAULT NULL COMMENT '确认收货时间',
  `pay_words` varchar(255) DEFAULT NULL COMMENT '买家留言',
  `box_num` int(11) DEFAULT NULL COMMENT '箱数',
  `jin_num` int(11) DEFAULT NULL COMMENT '斤数',
  `money` decimal(10,0) DEFAULT NULL COMMENT '金额',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

