-- ----------------------------
-- Table structure for t_biz_product
-- ----------------------------
DROP TABLE IF EXISTS `t_biz_product`;
CREATE TABLE `t_biz_product` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `businessmen_id` int(11) NOT NULL COMMENT '商家ID',
  `product_name` varchar(255) DEFAULT NULL COMMENT '水果名称',
  `original_price` decimal(10,2) DEFAULT NULL COMMENT '原价(优惠价为0时 原价作为单价)',
  `discounted_price` decimal(10,2) DEFAULT '0.00' COMMENT '优惠价',
  `sold` int(11) unsigned zerofill DEFAULT NULL COMMENT '已售(斤)',
  `in_stock` int(11) DEFAULT NULL COMMENT '库存',
  `title` varchar(1000) DEFAULT NULL COMMENT '标题',
  `description` text COMMENT '产品描述',
  `detail_img` varchar(255) DEFAULT NULL COMMENT '产品详情图',
  `product_img` varchar(255) DEFAULT NULL COMMENT '产品图',
  `is_promotion` tinyint(4) DEFAULT '0' COMMENT '是否促销(0否 1是)',
  `is_season` tinyint(4) DEFAULT '0' COMMENT '是否时令(0否 1是)',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `category_id` int(11) DEFAULT NULL COMMENT '水果品种',
  `type_id` int(11) DEFAULT NULL COMMENT '水果类别',
  `del_flag` tinyint(4) DEFAULT '0' COMMENT '0有效，1删除',
  `is_shelves` tinyint(4) DEFAULT NULL COMMENT '是否上架(1是 0否)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='产品管理表';

-- ----------------------------
-- Records of t_biz_product
-- ----------------------------

