DROP TABLE IF EXISTS `t_biz_product_sales`;
CREATE TABLE `t_biz_product_sales` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `sales_method` tinyint(4) DEFAULT NULL COMMENT '销售方式(0斤 1箱)',
  `pounds_num` int(11) DEFAULT NULL COMMENT '斤数(起售斤数和每箱斤数)',
  `product_id` int(11) DEFAULT NULL COMMENT '商品ID',
  `is_free_post` tinyint(4) DEFAULT NULL COMMENT '是否包邮(0是1否)',
  `free_post_jin` varchar(255) DEFAULT NULL COMMENT '包邮斤数(超过几斤包邮)',
  `fruit_score` int(11) DEFAULT NULL COMMENT '赠送果币',
  `post_money` decimal(10,0) DEFAULT NULL COMMENT '邮费',
  `create_time` datetime DEFAULT NULL,
  `del_flag` tinyint(4) DEFAULT '0' COMMENT '0有效1删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='商品销售信息';

